import styled from "styled-components";

function SectionSkills() {
  return (
    <Container>
      <Title>
        <h3>skill</h3>
      </Title>
      <Wrap>
        <SlideList>
          <li>
            <SlideText>
              <a href="javascript">CSS</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">JAVASCRIPT</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">REACT</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">PHOTOSHOP</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">XD</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">FIGMA</a>
              <span></span>
            </SlideText>
          </li>
          <li>
            <SlideText>
              <a href="javascript">GITHUB</a>
              <span></span>
            </SlideText>
          </li>
        </SlideList>
      </Wrap>
    </Container>
  );
}

export default SectionSkills;

const Container = styled.div`
  width: 100%;
  height: 45vw;
  max-width: 1400px;
  margin: 0 auto;
  background-color: ${({ theme }) => theme.colors.white_color};
`;

const Title = styled.div`
  margin-top: 140px;
  font-size: ${({ theme }) => theme.fonts.fontSemiMedium};
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  color: ${({ theme }) => theme.colors.main_color};
`;

const Wrap = styled.div`
  width: 100%;
  height: 100%;

  display: flex;
  justify-content: flex-end;
`;

const SlideList = styled.ul`
  width: 50%;
  height: 50%;

  position: relative;

  display: flex;
  flex-direction: column;
  li {
    z-index: 1;
    position: absolute;
    top: 0;
    left: 50%;
    width: 50%;
    height: 300px;
    background: #fff;
  }
`;

const SlideText = styled.div`
  position: relative;
  display: inline-block;

  a {
    z-index: 2;
    position: relative;
    color: ${({ theme }) => theme.colors.main_color};
    font-size: ${({ theme }) => theme.fonts.fontExtra};
    font-weight: ${({ theme }) => theme.fonts.weightExtra};
  }
  span {
    z-index: 1;
    display: inline-block;
    position: absolute;
    bottom: 50px;
    left: 0;
    width: 100%;
    height: 15%;
    background: #5053582c;
    transition: all 0.3s;
    overflow: hidden;

    &::before {
      content: "";
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: #0066ff;
      transition: all 0.3s;
    }
  }
`;
